import React from "react";
import { NavLink } from "react-router-dom";

export default function Nav() {
  return (
      <nav class="navbar navbar-expand-lg navbar-light bg-light">
          <NavLink exact to="/">
          <a class="navbar-brand">
          Aidchoo
              </a>
          </NavLink>

          <NavLink to="/map/trees">Login</NavLink>
      </nav>
  )
}
